import Header from "./Page/header";
import Footer from "./Page/footer";
import Home from "./Page/home";
import About from "./Page/about";
import Contact from "./Page/contact";
import Product from "./Page/product";

function App() {
  return (
    <div>
      <Header />
      <Home />
      <Product />
      <About />
      <Contact />
      <Footer />
    </div>
  );
}

export default App;
